import React from 'react';

const Like = (props) => {
    return (
        <div>
            (!props.liked) ?
            <i
                onClick={props.onClick}
                className="far fa-heart"></i>
            :
            <i
                onClick={props.onClick}
                className="fas fa-heart"></i>
        </div>
    );
};

export default Like;
